        file=open('C:\\temp\\SPE_txtan\\SPE_orgs\\'+str(filename)+'org_out.txt', 'r')
        data_org = file.read()
        my_list_org = data_org.split("\n")
           
        if filename == 1990:
            for key in industry_dict.keys():
                plot_ind[key] = []
            for key in academia_dict.keys():
                plot_acad[key] = []
                
        filename = filename + 1
        file.close()
